import React from 'react';
import Navbar from './components/Navbar';
import { Routes, Route, BrowserRouter } from 'react-router-dom';
import Guide from './components/Guide';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Navbar/>

        <Routes>
        <Route path="/guide" element = {<Guide/>}/>
        </Routes>
      </BrowserRouter>


    </div>
  );
}

export default App;
